// src/components/Quiz.js
import React, { useEffect, useState } from "react";

function Quiz({ file, title, onClose }) {
  const [data, setData] = useState(null);
  const [answers, setAnswers] = useState([]);
  const [step, setStep] = useState(0);
  const [result, setResult] = useState(null);

  useEffect(() => {
    fetch(`/assessments/${file}`)
      .then((res) => res.json())
      .then((json) => setData(json))
      .catch((err) => console.error("Error loading quiz:", err));
  }, [file]);

  if (!data) return <p>Loading...</p>;

  // Guard against missing fields
  if (!data.questions || !data.scoring) {
    return (
      <div className="quiz-container">
        <h3>{data.title || "Coming Soon"}</h3>
        <p>{data.description || "This assessment will be available soon."}</p>
        <button onClick={onClose}>Close</button>
      </div>
    );
  }

  const handleAnswer = (answer) => {
    setAnswers([...answers, answer]);

    if (step + 1 < data.questions.length) {
      setStep(step + 1);
    } else {
      calculateResult([...answers, answer]);
    }
  };

  const calculateResult = (allAnswers) => {
    if (data.scoring.method === "conflict_styles") {
      // Count style frequencies
      const counts = {};
      allAnswers.forEach((ans, idx) => {
        const q = data.questions[idx];
        const style = q.styles[ans];
        counts[style] = (counts[style] || 0) + 1;
      });

      // Find top style
      let topStyle = null;
      let max = 0;
      for (const [style, count] of Object.entries(counts)) {
        if (count > max) {
          topStyle = style;
          max = count;
        }
      }

      setResult({
        style: topStyle,
        description: data.descriptions[topStyle],
      });
    } else {
      // Fallback for other quiz types
      setResult({ message: "Scoring not yet implemented for this quiz." });
    }
  };

  if (result) {
    return (
      <div className="quiz-results">
        <h2>{title}</h2>
        {result.style ? (
          <>
            <h3>Your style: {result.style}</h3>
            <p><strong>Characteristics:</strong> {result.description.characteristics}</p>
            <p><strong>Strengths:</strong> {result.description.strengths}</p>
            <p><strong>Blindspots:</strong> {result.description.blindspots}</p>
            <p><strong>Advice:</strong> {result.description.advice}</p>
          </>
        ) : (
          <p>{result.message}</p>
        )}
        <button onClick={onClose}>Close</button>
      </div>
    );
  }

  const currentQ = data.questions[step];

  return (
    <div className="quiz-container">
      <h2>{title}</h2>
      <p>
        Question {step + 1} of {data.questions.length}
      </p>

      {/* If it's a simple string question */}
      {typeof currentQ === "string" && (
        <div>
          <p>{currentQ}</p>
          {/* Example: Yes/No, but you can customize */}
          <button onClick={() => handleAnswer("Yes")}>Yes</button>
          <button onClick={() => handleAnswer("No")}>No</button>
        </div>
      )}

      {/* If it's an object-based question */}
      {typeof currentQ === "object" && (
        <div>
          <p>{currentQ.question}</p>
          {Object.entries(currentQ.options).map(([key, text]) => (
            <button key={key} onClick={() => handleAnswer(key)}>
              {text}
            </button>
          ))}
        </div>
      )}

      <button onClick={onClose}>Close</button>
    </div>
  );
}

export default Quiz;
